import React, {useState} from 'react'; 


//Import Components
import Header from './components/Header';
import Current from './components/Current';
import Home from './components/Home';


function App() {
  let zipCode = Home.zipCode;


  if (zipCode.length === 5) {
    return (
    <React.Fragment>
      <Header />
      <Current zipCode={zipCode} />
    </React.Fragment>
    )
  } else {
  return (
    <React.Fragment>
      <Header />
      <Home />
    </React.Fragment>
  );
  }
}

export default App;
